VALUES ('27070864', 'Raviolini ricotta en spinazi', 'Pâte (50 %) : semoule de blé dur, farine de blé, œuf entier (23 %). Farce (50 %) : fromage frais à base de ricott (produit base de petit lait, lait, sel, correcteur d\'acidité : acide citrique ou l\'acide lactique), épinards (15 %), flocons de pom terre, produit de petit-lait, fromage râpé (lait, sel, présure, lysozyme de l\'œuf), huile de tournesol, sel, épices, arômes Préparation : Verser les pâtes ravioloni directement du sachet dans une casserole avec de l\'eau bouillante et laisser cuire environ 4 minutes. Ensuite, égoutter et agrémenter d\'une sauce de votre choix. Conservation : Conserver les ravioloni à maximum +7 oc. Une fois le paquet ouvert, conservez-le au maximum pendant deuxj réfrigérateur. Emballé sous atmosphère protectrice.', 'https://static.openfoodfacts.org/images/products/27070864/front_fr.10.400.jpg', '8', '3.2', '37', '4', '', '10', '1.3', '0.511811023622047', '', '0');

