INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('27244470', 'chilli con carne sauce.mix chilli con carne sauce mix', 'For best resulls le an beef mince and 2 medium size chopped onions for 5 minutes or until the meat has browned. Drain off any excess liquid. Blend the contents of the sachet with 150ml cold water and pour into the saucepan, mixing well. Add 400g can of chopped tomatoes and 400g can of kidney beans, drained. Bring to the boil, stirring frequently. Cover and simmer on a gentle heat for 30 minutes, stirring occasionally. Check product is piping hot before serving. Do not re-heat. We have given you these cooking instructions as a guide only. INGREDIENTS Potato Starch, Wheat Flour, Maltodextrin, Salt, Tomato Powder (7.8%), Garlic Powder 15.0%), 0nion Powder 15.0%). Chilli Powder (3.5%), Flavourings, Barley Malt Extract Powder, Colours (Paprika Extract, Beetroot Red), Grouno Cumin, Sugar, Ground Black Pepper, Palm Fat, Ground Paprika, Citric Acid. Allergy Advice! for allergens, includin cereals containing gluten, see ingredients in bold. STORAGE Store in a cool, dry place.', '', '', '', '', '', '', '', '', '', '', '1');

